import React from "react";
import "./post.css";

function Post(props) {
  return (
    <div>
      <h1>{props.name}</h1>
      <Image className="img" src={props.img} alt="" />
      <p>{props.desc}</p>
      <p>commentsCount: {props.comm}</p>
    </div>
  );
}
export default Post;
